	public int lengthOfLongestSubstring(String s){
		int maxLength = 0;
		int[] map = new int[256];
		Arrays.fill(map, -1);
		char[] a = s.toCharArray();
		int start = 0;
		for (int i = 0; i < a.length; i++) {
			if (map[a[i]] >= start) {
				maxLength = Math.max(maxLength, (i - start));
				start = map[a[i]] + 1;
			}
			map[a[i]] = i;
		}
		return Math.max(maxLength, (a.length - start));

	}
	
